import ExpenseItem from "./ExpenseItem";

function Expenses(props) {
  return (
    <div>
      <ExpenseItem
        date={props.cazzo[0].date}
        title={props.cazzo[0].title}
        amount={props.cazzo[0].amount}
      />
    </div>
  );
}

export default Expenses;
